async function getIcon(name) {
  return {path: AQI_ICONS_MAP[name]?.path};
}
async function getIconList() {
  return Object.entries(AQI_ICONS_MAP).map(([icon, content]) => ({
    name: icon,
    keywords: content.keywords,
  }));
}

